import React from "react";
import axios from "axios";
import { View, Text, TouchableOpacity, Modal, WebView, Button, Linking } from "react-native";

export default function Payment() {
  const products = [
    {
      id: 1,
      name: "product 1",
      price: 100,
      quantity: 1
    },
    {
      id: 2,
      name: "product 2",
      price: 10,
      quantity: 2
    }
  ];
  const total = 120;
  var body = {
    userName: 'Fred',
    userEmail: 'Flintstone@gmail.com'
  }

  function handleClick() {
    axios({
      method: 'post',
      url: '/addUser',
      data: body
    })
      .then(function (response) {
        console.log(response);
      })
      .catch(function (error) {
        console.log(error);
      });
    Linking.openURL('http://192.168.1.103:5000/paypal');
  };
  return (
    <View style={{ marginTop: 100 }}>
      <Button title="Click me" onPress={handleClick} />
    </View>
  );
}
